import { Layout, Header, Navigation,Drawer,Content } from 'react-mdl';
import main from './link/main';
import './App.css';


class App extends Component {
 render(){
    return (
    <div className="demo-big-content">
    <Layout fixedHeader>
        <Header title={<span><span style={{ color: '#ddd' }}>Dandi / </span><strong>Portfolio</strong></span>}>
            <Navigation>
                <a href="/">Link</a>
                <a href="/">Link</a>
                <a href="/">Link</a>
                <a href="/">Link</a>
            </Navigation>
        </Header>
        <Drawer title="Title">
            <Navigation>
                <a href="/">Link</a>
                <a href="/">Link</a>
                <a href="/">Link</a>
                <a href="/">Link</a>
            </Navigation>
        </Drawer>
        <Content>
            <div className="page-content" />
            <main />
        </Content>
    </Layout>
</div>
  );
}
}

export default App;
